import playerRank from './PlayerRank.json'

var allPlayers = new Array(10);
const axios = require('axios').default;

function getPlayers() {
    var allPlayers = new Array(10);
    for (var j = 1; j <= 10; j++) {
        var fullName = playerRank[j.toString()];
        console.log(fullName);
        axios.get('https://www.balldontlie.io/api/v1/players?search=' + fullName)
            .then(function (response) {
                var player = response.data;
                allPlayers[j - 1] = player.data[0];
            })
            .catch(function (error) {
                console.log(error);
            })
            .then(function () {
            });
    }
    return allPlayers;
}
